import React from "react";

const NotFound = () => {
  return (
    <React.Fragment>
      <img
        src="/img/detective_pikachu.png"
        className="rounded mx-auto d-block"
        alt="Not found"
      />
      <h1 className="display-1 text-center">Not found</h1>
    </React.Fragment>
  );
};

export default NotFound;
